In this final episode, @holrmagazine sets up shop in the studio as the first official WANDERSPACE booking. Meanwhile Jack and Jarret prep the install for the featured background by artist Candice Kaye. Will WANDERSPACE be the studio they hoped or will it be a disaster... @holrmagazine + @yourwanderspace @_candicekaye_ @katieswallpaper

